  array('id' => '17810','lang' => 'lk','lang_key' => '1. Download the skeleton file and fill it with data.','lang_value' => '1. எலும்புக்கூடு கோப்பை பதிவிறக்கம் செய்து தரவு நிரப்பவும்.','created_at' => '2021-02-09 13:43:51','updated_at' => '2021-02-09 13:43:51'),
  array('id' => '17811','lang' => 'lk','lang_key' => '2. You can download the example file to understand how the data must be filled.','lang_value' => '2. தரவு எவ்வாறு நிரப்பப்பட வேண்டும் என்பதைப் புரிந்து கொள்ள உதாரணக் கோப்பைப் பதிவிறக்கலாம்.','created_at' => '2021-02-09 13:43:51','updated_at' => '2021-02-09 13:43:51'),
  array('id' => '17812','lang' => 'lk','lang_key' => '3. Once you have downloaded and filled the skeleton file, upload it in the form below and submit.','lang_value' => '3. நீங்கள் எலும்புக்கூடு கோப்பை பதிவிறக்கம் செய்து பூர்த்தி செய்தவுடன், அதை கீழே உள்ள படிவத்தில் பதிவேற்றி சமர்ப்பிக்கவும்.','created_at' => '2021-02-09 13:43:51','updated_at' => '2021-02-09 13:43:51'),
  array('id' => '17813','lang' => 'lk','lang_key' => '4. After uploading products you need to edit them and set products images and choices.','lang_value' => '4. தயாரிப்புகளை பதிவேற்றிய பிறகு நீங்கள் அவற்றைத் திருத்த வேண்டும் மற்றும் தயாரிப்புகளின் படங்களையும் தேர்வுகளையும் அமைக்க வேண்டும்.','created_at' => '2021-02-09 13:43:51','updated_at' => '2021-02-09 13:43:51'),
  array('id' => '17814','lang' => 'lk','lang_key' => 'Download CSV','lang_value' => 'CSV ஐ பதிவிறக்கவும்','created_at' => '2021-02-09 13:43:51','updated_at' => '2021-02-09 13:43:51'),
  array('id' => '17815','lang' => 'lk','lang_key' => '1. Category,Sub category,Sub Sub category and Brand should be in numerical ids.','lang_value' => '1. வகை, துணை வகை, துணை துணை வகை மற்றும் பிராண்ட் எண் ஐடிகளில் இருக்க வேண்டும்.','created_at' => '2021-02-09 13:43:51','updated_at' => '2021-02-09 13:43:51'),
  array('id' => '17816','lang' => 'lk','lang_key' => '2. You can download the pdf to get Category,Sub category,Sub Sub category and Brand id.','lang_value' => '2. வகை, துணை வகை, துணை துணை வகை மற்றும் பிராண்ட் ஐடியைப் பெற நீங்கள் PDF ஐ பதிவிறக்கம் செய்யலாம்.','created_at' => '2021-02-09 13:43:51','updated_at' => '2021-02-09 13:43:51'),
