  array('id' => '18799','lang' => 'lk','lang_key' => 'This is used for search. Input those words by which cutomer can find this product.','lang_value' => 'இது தேடலுக்குப் பயன்படுத்தப்படுகிறது. கட்டோமர் இந்த தயாரிப்பைக் கண்டுபிடிக்கக்கூடிய சொற்களை உள்ளிடவும்.','created_at' => '2021-02-09 13:45:33','updated_at' => '2021-02-09 13:45:33'),
  array('id' => '18800','lang' => 'lk','lang_key' => 'These images are visible in product details page gallery. Use 600x600 sizes images.','lang_value' => 'இந்த படங்கள் தயாரிப்பு விவரங்கள் பக்க கேலரியில் தெரியும். 600x600 அளவிலான படங்களைப் பயன்படுத்தவும்.','created_at' => '2021-02-09 13:45:33','updated_at' => '2021-02-09 13:45:33'),
  array('id' => '18801','lang' => 'lk','lang_key' => 'This image is visible in all product box. Use 300x300 sizes image. Keep some blank space around main object of your image as we had to crop some edge in different devices to make it responsive.','lang_value' => 'இந்த படம் எல்லா தயாரிப்பு பெட்டியிலும் தெரியும். 300x300 அளவிலான படத்தைப் பயன்படுத்தவும். உங்கள் படத்தின் முக்கிய பொருளைச் சுற்றி சில வெற்று இடத்தை வைத்திருங்கள், ஏனெனில் நாங்கள் அதை பதிலளிக்க பல்வேறு சாதனங்களில் சில விளிம்புகளை செதுக்க வேண்டியிருந்தது.','created_at' => '2021-02-09 13:45:33','updated_at' => '2021-02-09 13:45:33'),
  array('id' => '18802','lang' => 'lk','lang_key' => 'Use proper link without extra parameter. Don\'t use short share link/embeded iframe code.','lang_value' => 'கூடுதல் அளவுரு இல்லாமல் சரியான இணைப்பைப் பயன்படுத்தவும். குறுகிய பங்கு இணைப்பு / உட்பொதிக்கப்பட்ட ஐஃப்ரேம் குறியீட்டைப் பயன்படுத்த வேண்டாம்.','created_at' => '2021-02-09 13:45:33','updated_at' => '2021-02-09 13:45:33'),
